const axios = require('axios');



let album = axios({
    method: 'get',
    url: 'https://accounts.spotify.com/authorise',
    data: {
        client_id: 'a533855a85d5443eb1964a9947a6ef7b',
        response: 'Flintstone'
    }
});
console.log(album)
